const create3DGraph = () => {
  const graph = new G6.Graph({
    container: container as HTMLElement,
    width,
    height: 1400,
    type: 'graph',

    renderer: 'webgl-3d',
    // layout: {
    //   type: 'force',
    //   dimensions: 3,
    //   // iterations: 100,
    //   minMovement: 3,
    //   center: [width / 2, height / 2, 0],
    // },
    modes: {
      default: [
        {
          type: 'orbit-canvas-3d',
          trigger: 'drag',
        },
        'zoom-canvas-3d',
      ],
    },

    data: { nodes: layoutNodes3D, edges },
    // @ts-ignore
    theme: {
      type: 'spec',
      specification: {
        node: {
          dataTypeField: 'cluster',
        },
      },
    },
    edge: (innerModel) => {
      return {
        ...innerModel,
        data: {
          ...innerModel.data,
          keyShape: {
            lineWidth: 0.5,
          },
          type: 'line-edge',
        },
      };
    },
    node: (innerModel) => {
      return {
        ...innerModel,
        data: {
          ...innerModel.data,
          type: 'sphere-node',
          keyShape: {
            r: 12,
          },
        },
      };
    },
  });

  const rotate = (camera, rx: number, ry: number, graph) => {
    const { width, height } = graph.canvas.getConfig();
    const dx = 20.0 / height;
    const dy = 20.0 / width;
    let motionFactorX = 10;
    let motionFactorY = 10;
    if (rx * rx > 2 * ry * ry) {
      motionFactorY *= 0.5;
    } else if (ry * ry > 2 * rx * rx) {
      motionFactorX *= 0.5;
    }

    const rotX = rx * dx * motionFactorX;
    const rotY = ry * dy * motionFactorY;

    camera.rotate(rotX, 0, 0);
  };

  setTimeout(() => {
    const camera = graph.canvas.getCamera();
    const oripos = camera.getPosition();
    let k = 0;
    const tick = () => {
      rotate(camera, 50, 50, graph);
      camera.setPosition([oripos[0], oripos[1], oripos[2] + k]);
      requestAnimationFrame(tick);
      k += 10;
    };
    tick();

  }, 1000);

  return graph;
};

